const navbar = (
  <Navbar
    logo={<TitleIcon />}
    projectLink="https://github.com/easycrawl-dev"
    chatLink="https://t.me/easycrawl"
    chatIcon={<TelegramIcon />}
  >
    {/* <LocaleSwitch lite /> */}
  </Navbar>
)

const footer = <Footer>MIT {new Date().getFullYear()} © Nextra.</Footer>

type LayoutProps = Readonly<{
  children: ReactNode
  params: Promise<{
    lang: string
  }>
}>

const RootLayout: FC<LayoutProps> = async ({ children, params }) => {
  const { lang } = await params
  const dictionary = await getDictionary(lang)
  let pageMap = await getPageMap(`/${lang}`)

  if (lang === 'en') {
    pageMap = [
      ...pageMap,
    ]
  }

  return (
    <html lang={lang} suppressHydrationWarning>
      <Head />
      <body>
        <Layout
          navbar={navbar}
          pageMap={pageMap}
          footer={footer}
          docsRepositoryBase="https://github.com/easycrawl-dev/easycrawl-docs/blob/master"
          i18n={[
            { locale: 'en', name: 'English' },
            { locale: 'zh', name: '中文' }
          ]}
          sidebar={{
            defaultMenuCollapseLevel: 1,
            autoCollapse: true
          }}
          toc={{
            backToTop: dictionary.backToTop,
            extraContent: (<></>)
          }}
          editLink={dictionary.editPage}
          nextThemes={{ defaultTheme: 'dark' }}
          lastUpdated={<LastUpdated>{dictionary.lastUpdated}</LastUpdated>}
          themeSwitch={{
            dark: dictionary.dark,
            light: dictionary.light,
            system: dictionary.system
          }}
        >
          {children}
        </Layout>
      </body>
    </html>
  )
}

export default RootLayout